import React from "react";
import { useParams } from "react-router-dom";


function ArtistsPage() {
    let { artistId } = useParams();
    const artist = {
        name: "Austin",
        popularity: 12,
        genre: "Country",
        albums: ["this", "dsf", "tha"],
        futureEvents: ["this", "dsf", "tha"]
    }


    return (
        <>
            <div class="artist-page m-5 g-5 text-start d-flex flex-column">
                <h1>Austin</h1>
                <h3>#12</h3>
                <h3 class ="mb-5">Country</h3>

                <h2>Albums</h2>
                <div class="d-flex  text-start">

                    {
                        artist.albums.map((albums) => (
                            <div class="card bg-secondary text-white col-lg-2 ms-4">
                                <img class="card-img-top " src="/chick.png" alt="albumCover" />
                                <p>{albums}</p>
                            </div>
                        ))
                    }
                </div>
            </div>


        </>
    );
}

export default ArtistsPage;

